import React from "react";
import ReactPlayer from "react-player";

const Modal = ({ open }) => {
  if (!open) return null;
  return (
    <div className="overlay">
      <div className="modalContainer">
        <ReactPlayer
          url="https://www.youtube.com/watch?v=JNbGl_m2N-c"
          className="flex react-player fixed top-0"
          playing
          width="50%"
          height="50%"
          center
          controls={false}
        />
      </div>
    </div>
  );
};

export default Modal;
